import React,{ useEffect} from 'react';
import Messenger from './../Components/Messenger/index.jsx';
import axios from 'axios';

function MessengerContainer(){

  const getMessageOneUser = async (idUser) => {
      await axios.post('/api/auth/detail-message/'+ idUser)
      .then((res) => {
        console.log(res);
      })
      .catch((e) => {
        console.log(e);
      })
  }

  return(
    <Messenger getMessageOneUser={getMessageOneUser}/>
  )
}

export default MessengerContainer;
